      bb = xorTable[i][24*j + 19][(c >>  4) & 0xf][(d >>  4) & 0xf];
      cc = xorTable[i][24*j + 20][(a >>  0) & 0xf][(b >>  0) & 0xf];
      dd = xorTable[i][24*j + 21][(c >>  0) & 0xf][(d >>  0) & 0xf];
